import React, { useState } from "react";
import axios from "axios";
import VideoPlayerComponent from "./VideoPlayerComponent";

const Snapdown = () => {
  const [username, setUsername] = useState("");
  const [stories, setStories] = useState([]);
  const [viewMode, setViewMode] = useState("list"); // 'list' or 'grid'
  const [filter, setFilter] = useState("all"); // 'all', 'images', 'videos'
  const [error, setError] = useState("");

  const fetchStories = async () => {
    if (!username.trim()) {
      setError("‚ö†Ô∏è Please enter a valid username.");
      return;
    }

    try {
      console.log("Fetching stories for:", username);
      const response = await axios.get(
        `https://lucky-shadow-8a00.aeyaalli00963.workers.dev/?username=${username}`
      );

      console.log("API Response:", response.data);

      if (!response.data || !Array.isArray(response.data.stories)) {
        setError("‚ùå Unexpected API response. Please try again.");
        return;
      }

      const mediaUrls = response.data.stories.map((url) => ({
        url,
        isVideo: url.includes(".mp4"),
        isImage: !url.includes(".mp4"),
      }));

      if (mediaUrls.length === 0) {
        setError("‚ö†Ô∏è No stories found for this username.");
      } else {
        setStories(mediaUrls);
        setError("");
        console.log("Updated stories state:", mediaUrls);
      }
    } catch (error) {
      console.error("Error fetching stories:", error);
      setError("‚ùå Failed to fetch stories. Please try again.");
    }
  };

  const downloadStory = async (url) => {
    try {
      const response = await axios.get(url, { responseType: "blob" });
      const blob = new Blob([response.data]);
      const link = document.createElement("a");
      link.href = URL.createObjectURL(blob);
      link.download = url.split("/").pop();
      link.click();
    } catch (error) {
      console.error("Error downloading story:", error);
      alert("‚ùå Failed to download story.");
    }
  };

  return (
    <div>
      <h1>üì∏ Snapdown</h1>
      <input
        type="text"
        placeholder="Enter Snapchat username"
        value={username}
        onChange={(e) => setUsername(e.target.value)}
      />
      <button onClick={fetchStories}>üîç Search</button>

      {error && <p style={{ color: "red", fontWeight: "bold" }}>{error}</p>}

      <div>
        <button onClick={() => setViewMode("list")}>üìú List View</button>
        <button onClick={() => setViewMode("grid")}>üî≤ Grid View</button>
      </div>

      <div>
        <button onClick={() => setFilter("all")}>üåç All</button>
        <button onClick={() => setFilter("images")}>üñºÔ∏è Images</button>
        <button onClick={() => setFilter("videos")}>üìπ Videos</button>
      </div>

      <div className={viewMode === "list" ? "list-view" : "grid-view"}>
        {stories.length > 0 ? (
          stories
            .filter((story) => {
              if (filter === "images") return story.isImage;
              if (filter === "videos") return story.isVideo;
              return true;
            })
            .map((story, index) => (
              <div key={index} style={{ margin: "10px" }}>
                {story.isVideo ? (
                  <VideoPlayerComponent url={story.url} />
                ) : (
                  <img src={story.url} alt={`Story ${index}`} style={{ maxWidth: "100%" }} />
                )}
                <button onClick={() => downloadStory(story.url)}>‚¨áÔ∏è Download</button>
              </div>
            ))
        ) : (
          <p>No stories found.</p>
        )}
      </div>
    </div>
  );
};

export default Snapdown;
